import React from "react";
import logo from "./React-icon.svg.png"
let Header = () => {
  return (
    <header>
      <nav className="flex">
        <img src={logo} 
        alt="pic1" />
        <h3>React facts</h3>
        <h4>React Course - Project</h4>
      </nav>
    </header>
  );
};
export default Header;
